DROP TABLE IF EXISTS `xw_account_withdraw`;
CREATE TABLE `xw_account_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `currency_chain_id` int(11) NOT NULL COMMENT '币链id',
  `chain_id` int(11) NOT NULL COMMENT '链id',
  `currency_id` int(11) NOT NULL COMMENT '币种ID',
  `currency_code` varchar(16) NOT NULL COMMENT '币种',
  `amount` decimal(16,6) NOT NULL COMMENT '提现数量',
  `fee` decimal(16,6) NOT NULL COMMENT '提现手续费',
  `real_amount` decimal(16,6) NOT NULL COMMENT '实际到账',
  `withdraw_address_id` int(11) NOT NULL COMMENT '提現地址id',
  `to_address` varchar(256) NOT NULL COMMENT '提现地址',
  `memo` varchar(100) NOT NULL COMMENT '标签',
  `tx_id` varchar(255) NOT NULL COMMENT '链上交易号',
  `status` int(2) NOT NULL COMMENT '状态：0、待审核；1、提现成功；2、提现失败；3、确认',
  `created_at` datetime DEFAULT NULL,
  `checked_at` datetime DEFAULT NULL COMMENT '审核时间',
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `member_id` (`member_id`) USING BTREE,
  KEY `symbol` (`currency_id`) USING BTREE,
  KEY `add_time` (`created_at`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

