-- ----------------------------
-- Table structure for xw_currency
-- ----------------------------
DROP TABLE IF EXISTS `xw_currency`;
CREATE TABLE `xw_currency` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `image` varchar(255) NOT NULL COMMENT '代表图片',
  `name_cn` varchar(16) NOT NULL COMMENT '中文名',
  `name_en` varchar(16) NOT NULL COMMENT '英文名',
  `code` varchar(16) NOT NULL COMMENT '标识符',
  `currency_precision` int(2) NOT NULL COMMENT '货币小数位',
  `summary` varchar(255) NOT NULL COMMENT '简介',
  `link` varchar(255) NOT NULL COMMENT '详情链接',
  `start_at` datetime DEFAULT NULL COMMENT '发行时间',
  `explorer` varchar(150) NOT NULL COMMENT '浏览器',
  `turnover` decimal(20,6) NOT NULL COMMENT '流通',
  `account_type` int(2) NOT NULL DEFAULT '1' COMMENT '账户类型：1、地址模式；2、账户模式；',
  `recharge_address` varchar(255) NOT NULL COMMENT '充值地址',
  `is_trade` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启交易',
  `is_recharge` tinyint(1) NOT NULL COMMENT '是否开启充值',
  `is_withdraw` tinyint(1) NOT NULL COMMENT '是否开启提现',
  `is_transfer` tinyint(1) NOT NULL COMMENT '是否支持劃轉',
  `sort_order` int(4) NOT NULL COMMENT '排序',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`),
  UNIQUE KEY `name_en` (`name_en`),
  KEY `status` (`status`),
  KEY `sort_order` (`sort_order`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='币种设置';

