  `template` varchar(200) NOT NULL DEFAULT '' COMMENT '前端模板',
  `admin_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
  `created_at` datetime NOT NULL COMMENT '创建时间',
